function formatYMM(YMM){
    const str = YMM.trim().split(" ");
    const first = str[0]? `${str[0]}<br>` : "";
    const second = str[1]? `${str[1]}<br>`: "";
    const third  = str[2]? `${str[2]} ${str[3]? str[3]: ""}`: "";
    const all = str[4]? str.slice(4).join(" "): "";

    return `${first} ${second} ${third} ${all}`
}

